clear variablesclose allload CCCValidation.mat I_vec_CCC = I_vec;t_vec_CCC = tVec;v_vec_CCC = vVecAbs;rho_mat_CCC = rho_mat;phi_s_mat_CCC = phi_s_mat;c_mat_CCC = c_mat;phi_l_mat_CCC = phi_l_mat;load CVDValidation.mat I_vec_CVD = I_vec;t_vec_CVD = tVec;v_vec_CVD = vVecAbs;rho_mat_CVD = rho_mat;phi_s_mat_CVD = phi_s_mat;c_mat_CVD = c_mat;phi_l_mat_CVD = phi_l_mat;ll_mat_full = horzcat(ll_mat,max(max(ll_mat))+ll_mat);seperator_mat =  ones(rows(ll_mat),2*(length(ll_mat)-length(ls_mat)))*NaN;rho_mat_CCC(end,:) = NaN;rho_mat_CCC_full = horzcat(rho_mat_CCC,seperator_mat,-fliplr(rho_mat_CCC));phi_s_mat_CCC(end,:) = NaN;phi_s_mat_CCC_full = horzcat(phi_s_mat_CCC,seperator_mat,-fliplr(phi_s_mat_CCC));phi_l_mat_CCC(end,:) = NaN;phi_l_mat_CCC_full = horzcat(phi_l_mat_CCC,-fliplr(phi_l_mat_CCC));c_mat_CCC(end,:) = NaN;c_mat_CCC_full = horzcat(c_mat_CCC,(930*2)-fliplr(c_mat_CCC));rho_mat_CVD(end,:) = NaN;rho_mat_CVD_full = horzcat(rho_mat_CVD,seperator_mat,-fliplr(rho_mat_CVD));phi_s_mat_CVD(end,:) = NaN;phi_s_mat_CVD_full = horzcat(phi_s_mat_CVD,seperator_mat,-fliplr(phi_s_mat_CVD));phi_l_mat_CVD(end,:) = NaN;phi_l_mat_CVD_full = horzcat(phi_l_mat_CVD,-fliplr(phi_l_mat_CVD));c_mat_CVD(end,:) = NaN;c_mat_CVD_full = horzcat(c_mat_CVD,(930*2)-fliplr(c_mat_CVD));I_vec_Validation = horzcat(I_vec_CCC,I_vec_CVD);t_vec_Validation = horzcat(t_vec_CCC,t_vec_CVD);v_vec_Validation = horzcat(v_vec_CCC,v_vec_CVD);% EXTRACT AND PROCESS CURRENT DATACurrentData = csvread('CurrentFromPlot1.csv');CurrentTime = CurrentData(:,1);CurrentCurrent = CurrentData(:,2);% EXTRACT AND PROCESS VOLTAGE DATAVoltageData = csvread('VoltageFromPlot1.csv');VoltageTime = VoltageData(:,1);VoltageVoltage = VoltageData(:,2);figure(1)scatter(VoltageTime,VoltageVoltage)hold onplot(t_vec_Validation,v_vec_Validation)hold offtitle('Terminal potential')xlabel('Time, s') ylabel('Potential, V')xlim([0 17.65])ylim([1.3 2.1])figure(2)scatter(CurrentTime,CurrentCurrent)hold onplot(t_vec_Validation,I_vec_Validation)title('Terminal current')xlabel('Time ,s') ylabel('Current, A')xlim([0 17.65])ylim([-600 200])figure(3)plot(transpose(ll_mat_full),transpose(rho_mat_CCC_full))xlim([0 max(max(ll_mat_full))])figure(4)plot(transpose(ll_mat_full),transpose(rho_mat_CVD_full))xlim([0 max(max(ll_mat_full))])figure(5)plot(transpose(ll_mat_full),transpose(phi_s_mat_CCC_full ))xlim([0 max(max(ll_mat_full))])figure(6)plot(transpose(ll_mat_full),transpose(phi_s_mat_CVD_full))xlim([0 max(max(ll_mat_full))])figure(7)plot(transpose(ll_mat_full),transpose(c_mat_CCC_full))xlim([0 max(max(ll_mat_full))])figure(8)plot(transpose(ll_mat_full),transpose(c_mat_CVD_full))xlim([0 max(max(ll_mat_full))])figure(9)plot(transpose(ll_mat_full),transpose(phi_l_mat_CCC_full))xlim([0 max(max(ll_mat_full))])figure(10)plot(transpose(ll_mat_full),transpose(phi_l_mat_CVD_full))xlim([0 max(max(ll_mat_full))])